include_once($__appvar["basedir"]."/html/rapport/rapportVertaal.php");

class RapportFRONT_L86
{
	function RapportFRONT_L86($pdf, $portefeuille, $rapportageDatumVanaf, $rapportageDatum)
	{
		$this->pdf = &$pdf;
		$this->pdf->rapport_type = "FRONT";
		$this->pdf->rapport_titel = "Titel pagina";
		$this->rapDatumJul=db2jul($rapportageDatum);

		$this->portefeuille = $portefeuille;
		$this->achtergrondPlaatje=base64_decode('');
    $this->logo=base64_decode('');
	}

	function writeRapport()
	{
		//global $__appvar;
    $this->pdf->AddPage('P');
    $this->pdf->frontPage = true;
    $this->pdf->memImage($this->achtergrondPlaatje,0,0,210);
  
    $logoW=55;
    $circleW=80;
    $lineColor=array(238,202,96);
    $this->pdf->setDrawColor($lineColor[0],$lineColor[1],$lineColor[2]);
    $this->pdf->setFillColor($lineColor[0],$lineColor[1],$lineColor[2]);
    
   
    $this->pdf->SetLineWidth(3);
    $this->pdf->Circle(210/2,140,$circleW,0,180,'DF','','');
    $this->pdf->Circle(210/2,140,$circleW,0,360,'D','','');
    $this->pdf->SetLineWidth(.2);
    $this->pdf->memImage($this->logo,210/2-$logoW/2,165,$logoW);
    
    $query="SELECT naam,naam1 FROM CRM_naw WHERE portefeuille='".mysql_real_escape_string($this->portefeuille)."'";
    $db=new DB();
    $db->SQL($query);
    $crmData=$db->lookupRecord();
    /*
    $query="SELECT emailAdres FROM Gebruikers WHERE Accountmanager='".mysql_real_escape_string($this->pdf->portefeuilledata['Accountmanager'])."'";
    $db->SQL($query);
    $accountmanager=$db->lookupRecord();
*/
    if($this->pdf->lastPOST['anoniem']==1)
    {
      $crmData=array('naam1'=>'Demo rapportage');
    }

    $this->pdf->setXY(0,35);
    $this->pdf->setTextColor(255,255,255);
    $this->pdf->SetFont($this->pdf->rapport_font,'',38);//$this->pdf->rapport_fontsize+6);
    $this->pdf->cell(210,5,"RAPPORTAGE PER ".date("d-m-Y",$this->rapDatumJul),0,0,'C');
    
    $this->pdf->setXY(55,80);
    $this->pdf->setTextColor(0,0,0);
    //$start=40+15;
    $this->pdf->setDrawColor(0,0,0);
    //$this->pdf->line($start,$this->pdf->getY(),$start+100,$this->pdf->getY());
    $this->pdf->SetFont($this->pdf->rapport_font,'B',26);//$this->pdf->rapport_fontsize+6);
    $this->pdf->MultiCell(100,12,$crmData['naam'],0,'C');
    $this->pdf->setXY(55,$this->pdf->getY());
    $this->pdf->MultiCell(100,12,$crmData['naam1'],0,'C');
    
    $this->pdf->setXY(40,122);
    $this->pdf->SetFont($this->pdf->rapport_font,'',20);//$this->pdf->rapport_fontsize+6);
    $this->pdf->MultiCell(210-80,14,date("d-m-Y",$this->rapDatumJul),0,'C');
    
  
    
    $this->pdf->setXY(7,253);
    $this->pdf->AutoPageBreak=false;
    $this->pdf->SetFont($this->pdf->rapport_font,'B',14);//$this->pdf->rapport_fontsize+6);
    $this->pdf->MultiCell(200,6,"Client First Finance",0,'L');
    $this->pdf->setXY(7,260);
    $this->pdf->SetFont($this->pdf->rapport_font,'',12);
    $this->pdf->MultiCell(200,6,"ZUIDER STATIONSWEG 20
2061 HE BLOEMENDAAL
E: boogaarts@cffinance.nl
T: +31 (0) 23 303 6333",0,'L');

    
    $this->pdf->AutoPageBreak=true;
    //$achtergrondKleur=array();
    

	}

}
